enum Expected<T, I, S> {
    Token(Option<T>, Option<T>),
    Slice(Option<I>, Option<S>),
    Custom(Cow),
    EOF(Option<T>),
}

fn error<I, R,
'_>(&'_ mut I, &'static str, Expected<I::Token, I::InSlice, I::Slice>)
-> Result<R, I> where I: Input

fn collection<C, I, O, F, '_>(&'_ mut I, I::Token, F, I::Token, I::Token)
-> Result<C, I> where C: Collection<Item = O>, I: Input,
F: for<'_> FnMut(&'_ mut I) -> Result<O, I>
